import React from 'react'


interface IProps{
    name: string;
    age: number;
    title: string;
}

let Customer:React.FC<IProps> = ({name, age, title}) => {
    // console.log(name, age, title);
    
    return(
        <React.Fragment>
            <h2>Customer Component</h2>
            <ul>
                <li>Name: {name}</li>
                <li>Age: {age}</li>
                <li>Title: {title}</li>
            </ul>
        </React.Fragment>
    )    


};
export default Customer;
